import Main from './breakingBad/main';
import Upload from './fileupload/upload';
import { useState } from 'react';
import './App.css';

const App = () => {
  const [x, setX] = useState(1);

  const func = () => {
    switch(x){
      case 1:<Main />;
      break;
      case 2:<Upload />;
      break;
    }
  }

  function bb(){
    setX(1);
  }

  function up(){
    setX(2);
  }

  return (
    <div className="App">
      <div className='Navbar'>
        <div className='list' onClick={bb}>Breaking Bad</div>
        <div className='list' onClick={up}>File upload</div>
      </div>
      {func}

    </div>
  );
}

export default App;
